		<guid isPermaLink="false">https://topfast.azurewebsites.net/?post_type=slots&#038;p=955#comment-167</guid>

					<description><![CDATA[Накрутил не одну тысячу спинов. Та какой там не одну тысячу. Не один десяток тысяч пожалуй. Сделал определённые выводы.
Появления этого слота от Microgaming я ждал с большим нетерпением. Но не был вознаграждён.
Да. Автомат сделан классно и качественно. Видеоряд просто супер,музыка под стать. Но вот математикой этого видеослота я крайне неудовлетворён. И это при том, что мне выпадал один раз даже так называемый хот-мод. А было это несколько лет назад. И самое интересное, то что он мне выпадал, я понял месяца через два ) Когда увидел лудовод чей-то. А так был списал просто на разницу в цветовой палитре (а в хотмоде во время бонусной игры появляется красная подсветка) между браузерной версией и скачиваемым клиентом :) Накидал он мне тогда прилично конечно, но после того случая я видел максимум умножение х100 - х150. Это за несколько лет активной в него игры ! В основном его нормальное умножение во время топовой 1024-линей бонуски это х20-х60. А это ерунда.]]></description>
			<content:encoded><![CDATA[<p>Накрутил не одну тысячу спинов. Та какой там не одну тысячу. Не один десяток тысяч пожалуй. Сделал определённые выводы.<br />
Появления этого слота от Microgaming я ждал с большим нетерпением. Но не был вознаграждён.<br />
Да. Автомат сделан классно и качественно. Видеоряд просто супер,музыка под стать. Но вот математикой этого видеослота я крайне неудовлетворён. И это при том, что мне выпадал один раз даже так называемый хот-мод. А было это несколько лет назад. И самое интересное, то что он мне выпадал, я понял месяца через два ) Когда увидел лудовод чей-то. А так был списал просто на разницу в цветовой палитре (а в хотмоде во время бонусной игры появляется красная подсветка) между браузерной версией и скачиваемым клиентом 🙂 Накидал он мне тогда прилично конечно, но после того случая я видел максимум умножение х100 &#8212; х150. Это за несколько лет активной в него игры ! В основном его нормальное умножение во время топовой 1024-линей бонуски это х20-х60. А это ерунда.</p>
]]></content:encoded>
		
